column14:
@michalvavrik Thanks for creating it here.

I'm a bit lost now about what we are trying to achieve here. After reading https://github.com/quarkusio/quarkus/issues/18818, I understand we want to avoid remote calls to Keycloak when the path is disabled.

Can you please confirm my understanding and how these changes are helping with it?

@JavierBotella the rules have a good structure.

However, we are reserving "1xxxxx" for custom user rules.

I suggest you use "91xxx", they are currently unused.

Thank you for this contribution!

@JavierBotella I think that's great now.

I'm approving this PR. Now it is blocked by https://github.com/wazuh/wazuh/pull/5175.

Unreported flaky test detected, please review

@sjweixel Thanks for the PR! Overall, looks good to me; I've just added some comments below. It's also necessary to create some tests to verify the proper solution.

@sjweixel Thanks for your updates, and sorry for the late response. 

I think this PR does more than it should (please see comment below). I've prepared separated PR for fixing the origination issue: https://github.com/keycloak/keycloak/pull/19922

If you still think the Keycloak behavior related to the admin creation lacks some behavior, please, create an issue for that and we can discuss the use cases more.

