@sbrajchuk The idea LGTM.

However, we should have this option here https://github.com/keycloak/keycloak/blob/main/quarkus/runtime/src/main/resources/application.properties. We have some others there and it helps to keep the default values we set for (unmapped) quarkus options in a single place.

If you manage to update this file and remove the changes to our scripts, it is enough from my side.

